import React from 'react'

export default function Categories(props) {


  return (
    <React.Fragment>
        <div className='categoriesContainer'>
            {props.categoriesData.map((elem)=>
              <div className='categoriesOuterContainer'>
                <div style={{backgroundImage:`url(${elem.imageURL})`,display:'flex',}}>
                  <h1>{elem.category}</h1>
                </div>
              </div>
            )}
        </div>
    </React.Fragment>
  )
}
